export interface Card {
  name: string;
  number: number;
  type: string[];
  rarity: 'Common' | 'Uncommon' | 'Rare' | 'Epic' | 'Legendary' | 'Mythical' ;
  move: string;
  isShiny: boolean;
  variant?: string;
  artist?: string;
  background?: string;
  exclusive?: string;
  audio: string;
}

export interface BoosterPack {
  id: string;
  name: string;
  filter: (card: Card) => boolean;
  weights?: Partial<Record<Card['rarity'], number>>;
  carouselCards?: string[];
  chaseCard?: string;
  shinyChase?: boolean;
}

